import React, { useState, useRef } from "react";

function App() {
  const [inputText, setInputText] = useState("");
  const [audioUrl, setAudioUrl] = useState(null);
  const [loading, setLoading] = useState(false);
  const [listening, setListening] = useState(false);
  const recognitionRef = useRef(null);

  // ðŸ”Š Send text to backend and get voice reply
  const handleSend = async (textToSend) => {
    const text = textToSend ?? inputText;
    if (!text.trim()) return alert("Please say or type something!");

    setLoading(true);
    setAudioUrl(null);

    try {
      const response = await fetch("http://localhost:3000/api/voice-chat", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ text }),
      });

      const contentType = response.headers.get("Content-Type");
      console.log("Response content-type:", contentType);

      if (!response.ok) {
        let errMsg = `Server error ${response.status}: `;
        try {
          const errData = await response.json();
          console.error("Backend error details:", errData);
          if (errData.error) errMsg += errData.error;
        } catch (e) {
          console.error("Could not parse error JSON:", e);
        }
        alert(errMsg);
        return;
      }

      const blob = await response.blob();
      console.log("Blob size:", blob.size, "type:", blob.type);

      if (!blob.size) {
        alert("Received empty audio from server.");
        return;
      }

      const url = URL.createObjectURL(blob);
      setAudioUrl(url);
    } catch (error) {
      console.error("Fetch error:", error);
      alert("Network error: " + error.message);
    } finally {
      setLoading(false);
    }
  };

  // ðŸŽ™ Start listening from mic
  const startListening = () => {
    const SpeechRecognition =
      window.SpeechRecognition || window.webkitSpeechRecognition;

    if (!SpeechRecognition) {
      alert(
        "Speech recognition is not supported in this browser. Try Chrome or Edge on desktop."
      );
      return;
    }

    if (listening) return; // already listening

    const recognition = new SpeechRecognition();
    recognition.lang = "en-IN"; // you can adjust this
    recognition.interimResults = false; // only final result
    recognition.maxAlternatives = 1;

    recognition.onstart = () => {
      console.log("Speech recognition started");
      setListening(true);
    };

    recognition.onerror = (event) => {
      console.error("Speech recognition error:", event.error);
      setListening(false);
      alert("Speech recognition error: " + event.error);
    };

    recognition.onend = () => {
      console.log("Speech recognition stopped");
      setListening(false);
    };

    recognition.onresult = (event) => {
      const transcript = event.results[0][0].transcript;
      console.log("Transcript:", transcript);
      setInputText(transcript);
      // Auto-send to backend after recognition
      handleSend(transcript);
    };

    recognitionRef.current = recognition;
    recognition.start();
  };

  // ðŸ›‘ (Optional) Stop listening manually
  const stopListening = () => {
    if (recognitionRef.current && listening) {
      recognitionRef.current.stop();
      setListening(false);
    }
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>ðŸŽ¤ Voice AI Chat (Gemini + ElevenLabs)</h2>

      <p style={{ marginBottom: "8px" }}>
        Click the mic, speak your question, and hear the AI reply.
      </p>

      <div style={{ marginBottom: "10px" }}>
        <textarea
          style={styles.textarea}
          rows="3"
          placeholder="Or type your message..."
          value={inputText}
          onChange={(e) => setInputText(e.target.value)}
        />
      </div>

      <div style={styles.buttonRow}>
        <button
          style={{
            ...styles.button,
            backgroundColor: listening ? "#dc3545" : "#28a745",
          }}
          onClick={listening ? stopListening : startListening}
          disabled={loading}
        >
          {listening ? "ðŸ›‘ Stop Listening" : "ðŸŽ™ Speak"}
        </button>

        <button
          style={styles.button}
          onClick={() => handleSend()}
          disabled={loading}
        >
          {loading ? "Generating..." : "Send Text"}
        </button>
      </div>

      {audioUrl && (
        <div style={{ marginTop: "20px" }}>
          <p>AI Voice Reply:</p>
          <audio controls src={audioUrl} />
        </div>
      )}
    </div>
  );
}

const styles = {
  container: {
    maxWidth: "600px",
    margin: "40px auto",
    textAlign: "center",
    fontFamily: "Arial, sans-serif",
    padding: "20px",
  },
  heading: {
    marginBottom: "12px",
  },
  textarea: {
    width: "100%",
    padding: "10px",
    fontSize: "16px",
    resize: "vertical",
  },
  buttonRow: {
    display: "flex",
    gap: "10px",
    justifyContent: "center",
  },
  button: {
    marginTop: "10px",
    padding: "10px 18px",
    fontSize: "16px",
    backgroundColor: "#007bff",
    color: "white",
    border: "none",
    borderRadius: "6px",
    cursor: "pointer",
  },
};

export default App;
